import express from 'express';
import EmployeService from "../services/employe.service";

const employeService = new EmployeService();

const employeRouter = express.Router()
    .post('/', async (req, res) => {
        try {
            let slider = await employeService.createSlider(req.file, req.body);
            console.log(req.body);
            res.status(201).send({
                STATUS: 201,
                MESSAGE: 'Created successfully',
                DATA: slider
            })
        } catch (e) {
            console.log(e);
            res.status(500).send({
                STATUS: 500,
                MESSAGE: 'INTERNAL SERVER ERROR'
            })
        }
    })

    .get('/', async (req, res) => {
        try {
            let sliders = await employeService.findAllSliders();
            res.status(200).send({
                STATUS: 200,
                MESSAGE: "SUCCESS",
                DATA: sliders
            })
        } catch (e) {
            console.log(e);
            res.status(500).send({
                STATUS: 500,
                MESSAGE: 'INTERNAL SERVER ERROR'
            })
        }
    })

    .get('/:id', async (req, res) => {
        try {
            let id = req.params.id;
            let sliders = await employeService.findSlider(id);
            if (!sliders) {
                res.status(404).send({
                    STATUS: 404,
                    MESSAGE: 'SLIDER NOT FOUND'
                })
            } else {
                res.status(200).send({
                    STATUS: 200,
                    MESSAGE: "SUCCESS",
                    DATA: sliders
                })
            }
        } catch (e) {
            console.log(e);
            res.status(500).send({
                STATUS: 500,
                MESSAGE: 'INTERNAL SERVER ERROR'
            })
        }
    })

    .delete('/:id', async (req,res) => {
        
    })

    .put('/:id', async (req, res) => {
        try{
            const {id} = req.params;
            let body = {...req.body};
            const image = req.file;
            let slider = await employeService.updateSlider(id, body, image);
            res.status(200).send({
                STATUS: 200,
                MESSAGE: 'Updated slider successfully',
                DATA: slider
            })
        } catch (e) {
            console.log(e);
            res.status(500).send({
                STATUS: 500,
                MESSAGE: 'Internal Server Error'
            })
        }
    });

    

export default employeRouter;

